export const Page3 = () => {
  return <div className="page3">
    <div className="page3__inner">
      <div className="page3__title">
        <div className="page3__button"></div>
        <h1 className="page3__heading"></h1>
        <p></p>
      </div>
      <div className="page3__items"></div>
    </div>
  </div>;
};
